import { makeStyles } from "@mui/styles";

const useStyles = makeStyles({
    profile :{
        backgroundImage : 'linear-gradient(90deg , #FFE00D , #FEA127)',
        height : '700px',
        display:'flex'
    },
    profileSVG:{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'flex-end',
        justifyContent: 'flex-end',
        alignContent: 'flex-end',
    },
    profilePic:{
        position:'absolute'
    },
    profilePicture:{
        display: 'flex',
        justifyContent: 'center',
    }
});
export default useStyles;
